        Function Get-VirtualProtectValue
       {
       Param(
       [Parameter(Position = 0, Mandatory = $true)]
      [UInt32]
  $SectionCharacteristics
    )
  
    $ = 0x0
if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_EXECUTE) -gt 0)
       {
if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_READ) -gt 0)
         {
      if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_WRITE) -gt 0)
         {
   $ = $Win32Constants.PAGE_EXECUTE_READWRITE
         }
      else
 {
   $ = $Win32Constants.PAGE_EXECUTE_READ
 }
     }
         else
         {
       if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_WRITE) -gt 0)
  {
       $ = $Win32Constants.PAGE_EXECUTE_WRITECOPY
}
         else
         {
         $ = $Win32Constants.PAGE_EXECUTE
         }
    }
        }
   else
   {
   if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_READ) -gt 0)
      {
    if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_WRITE) -gt 0)
       {
         $ = $Win32Constants.PAGE_READWRITE
      }
         else
     {
 $ = $Win32Constants.PAGE_READONLY
    }
       }
         else
    {
    if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_WRITE) -gt 0)
 {
$ = $Win32Constants.PAGE_WRITECOPY
}
else
 {
        $ = $Win32Constants.PAGE_NOACCESS
        }
}
}
         
if (($SectionCharacteristics -band $Win32Constants.IMAGE_SCN_MEM_NOT_CACHED) -gt 0)
   {
  $ = $ -bor $Win32Constants.PAGE_NOCACHE
    }

       return $
  }
    
        Function Update-MemoryProtectionFlags
     {
       Param(
      [Parameter(Position = 0, Mandatory = $true)]
     [System.Object]
    $PEInfo,
       
     [Parameter(Position = 1, Mandatory = $true)]
    [System.Object]
 $Win32Functions,
     
      [Parameter(Position = 2, Mandatory = $true)]
     [System.Object]
      $Win32Constants,
     
  [Parameter(Position = 3, Mandatory = $true)]
   [System.Object]
    $Win32Types
         )

       for( $i = 0; $i -lt $PEInfo.IMAGE_NT_HEADERS.FileHeader.NumberOfSections; $i++)
 {
     [IntPtr]$ = [IntPtr](Add-SignedIntAsUnsigned ([Int64]$PEInfo.SectionHeaderPtr) ($i * [System.Runtime.InteropServices.Marshal]::SizeOf([Type]$Win32Types.IMAGE_SECTION_HEADER)))
       $ = [System.Runtime.InteropServices.Marshal]::PtrToStructure($, [Type]$Win32Types.IMAGE_SECTION_HEADER)
         [IntPtr]$ = Add-SignedIntAsUnsigned ($PEInfo.PEHandle) ($.VirtualAddress)

       [UInt32]$ = Get-VirtualProtectValue $.Characteristics
    [UInt32]$ = $.VirtualSize
        
       [UInt32]$ = 0
   Test-MemoryRangeValid -DebugString "Update-MemoryProtectionFlags::VirtualProtect" -PEInfo $PEInfo -StartAddress $ -Size $ | Out-Null
         $ = $Win32Functions.VirtualProtect.Invoke($, $, $, [Ref]$)
         if ($ -eq $false)
  {
 Throw "Unable to change memory protection"
      }
  }
         }
    
