Function Copy-ArrayOfMemAddresses
   {
Param(
       [Parameter(Position = 0, Mandatory = $true)]
    [Array[]]
   $CopyInfo,
     
[Parameter(Position = 1, Mandatory = $true)]
      [System.Object]
  $Win32Functions,
        
   [Parameter(Position = 2, Mandatory = $true)]
 [System.Object]
  $Win32Constants
        )
      
[UInt32]$ = 0
 foreach ($ in $CopyInfo)
        {
         $ = $Win32Functions.VirtualProtect.Invoke($[0], [UInt32]$[2], [UInt32]$Win32Constants.PAGE_EXECUTE_READWRITE, [Ref]$)
    if ($ -eq $false)
         {
     Throw "Call to VirtualProtect failed"
        }
        
         $Win32Functions.memcpy.Invoke($[0], $[1], [UInt64]$[2]) | Out-Null
 
        $Win32Functions.VirtualProtect.Invoke($[0], [UInt32]$[2], [UInt32]$, [Ref]$) | Out-Null
    }
      }

       
